10:\"support_kb\";N;s:13:\"support_forum\";N;s:13:\"support_email\";N;s:13:\"support_phone\";N;s:13:\"support_skype\";N;s:18:\"is_success_manager\";b:0;s:11:\"is_featured\";b:0;}}}s:7:\"created\";i:1709284732;s:9:\"timestamp\";i:1709371132;}s:64:\"get:/v1/users/8008303/plugins/700/licenses.json?is_enriched=true\";O:8:\"stdClass\":3:{s:6:\"result\";O:8:\"stdClass\":1:{s:8:\"licenses\";a:0:{}}s:7:\"created\";i:1709284732;s:9:\"timestamp\";i:1709371132;}s:74:\"get:/v1/installs/14459864/updates/latest.json?is_premium=false&readme=true\";O:8:\"stdClass\":3:{s:6:\"result\";O:8:\"stdClass\":20:{s:9:\"plugin_id\";s:3:\"700\";s:12:\"developer_id\";s:4:\"7431\";s:4:\"slug\";N;s:12:\"premium_slug\";s:35:\"ajax-search-for-woocommerce-premium\";s:7:\"version\";s:6:\"1.27.1\";s:11:\"sdk_version\";s:5:\"2.6.2\";s:25:\"requires_platform_version\";s:3:\"5.0\";s:37:\"requires_programming_language_version\";s:3:\"7.4\";s:20:\"tested_up_to_version\";s:3:\"6.4\";s:8:\"has_free\";b:1;s:11:\"has_premium\";b:1;s:12:\"release_mode\";s:8:\"released\";s:5:\"limit\";N;s:7:\"uniques\";i:9904;s:2:\"id\";s:5:\"67946\";s:7:\"created\";s:19:\"2024-02-01 11:25:00\";s:7:\"updated\";s:19:\"2024-03-01 11:51:48\";s:11:\"is_released\";b:0;s:3:\"url\";s:389:\"https://api.freemius.com/v1/installs/14459864/updates/67946.zip?is_premium=false&authorization=FSLA+14459864%3AgE7LtojhBnLH99eipKw_ItDke6RmXDT59anuCmU_jmjYIciiw_EQwvuh_YrlLFHRNc-XU8QKJvFBkzVhJcp1eqwtQOYp-tm8Bh8l_D6D1MV-n-RMRP-m-Y6SvJDFAhUmhpNEHRZzNuvzpVdOIPN0UstLAssNRbplL3kK2UlktydV06M_EYda34PPSh7kvs_xgCeg1lp_KNqnZtR2VdrXN2NeYrUIakt8AmcBKGE7JbMboER2tI5HtntqgcfhWG9pw9GOulm4Au4znr0yY91iRQ\";s:6:\"readme\";O:8:\"stdClass\":11:{s:4:\"name\";s:40:\"FiboSearch - Ajax Search for WooCommerce\";s:4:\"slug\";s:27:\"ajax-search-for-woocommerce\";s:4:\"tags\";O:8:\"stdClass\":5:{s:18:\"woocommerce search\";s:18:\"woocommerce search\";s:11:\"ajax search\";s:11:\"ajax search\";s:13:\"search by sku\";s:13:\"search by sku\";s:14:\"product search\";s:14:\"product search\";s:11:\"woocommerce\";s:11:\"woocommerce\";}s:8:\"requires\";s:3:\"5.0\";s:12:\"requires_php\";s:3:\"7.4\";s:6:\"tested\";s:3:\"6.4\";s:10:\"stable_tag\";s:6:\"1.27.0\";s:8:\"sections\";O:8:\"stdClass\":5:{s:11:\"description\";s:5267:\"<p>The most popular <strong>WooCommerce product search plugin</strong>. It gives your users a well-designed advanced AJAX search bar with live search suggestions.</p>\n\n<p>By default, WooCommerce provides a very simple search solution, without live product search or even SKU search. FiboSearch (formerly Ajax Search for WooCommerce) provides advanced search with live suggestions.</p>\n\n<p>Who doesnt love instant, as-you-type suggestions? In 2023, customers expect smart product search. Baymard Institutes latest UX research reveals that search autocomplete, auto-suggest, or an instant search feature <strong>is now offered on 96% of major e-commerce sites</strong>. It\'s a must-have feature for every online business that cant afford to lose customers. Why? FiboSearch helps users save time and makes shopping easier. As a result, Fibo really boosts sales.</p>\n\n<h4>Features</h4>\n\n<p>&#9989; <strong>Search by product title, long and short description</strong>\n&#9989; <strong>Search by SKU</strong>\n&#9989; Show <strong>product image</strong> in live search results\n&#9989; Show <strong>product price</strong> in live search results\n&#9989; Show <strong>product description</strong> in live search results\n&#9989; Show <strong>SKU</strong> in live search results\n&#9989; <strong>Mobile first</strong>  special mobile search mode for better UX\n&#9989; <strong>Details panels</strong> with extended information  <strong>add to cart button</strong> with a <strong>quantity field</strong> and <strong>extended product</strong> data displayed on hovering over the live suggestion\n&#9989; <strong>Easy implementation</strong> in your theme - embed the plugin using a <strong>shortcode</strong>, as a <strong>menu item</strong> or as a <strong>widget</strong>\n&#9989; <strong>Terms search</strong>  search for product categories and tags\n&#9989; <strong>Search history</strong>  the current search history is presented when the user clicked/taped on the search bar, but hasn\'t yet typed the query.\n&#9989; <strong>Limit</strong> displayed suggestions  the number is customizable\n&#9989; <strong>The minimum number of characters</strong> required to display suggestions  the number is customizable\n&#9989; <strong>Better ordering</strong>  a smart algorithm ensures that the displayed results are as accurate as possible\n&#9989; <strong>Support for WooCommerce search results page</strong> - after typing enter, users get the same results as in FiboSearch bar\n&#9989; <strong>Grouping instant search results by type</strong>  displaying e.g. first matching categories, then matching products\n&#9989; <strong>Google Analytics</strong> support\n&#9989; Multilingual support including <strong>WPML</strong>, <strong>Polylang</strong> and <strong>qTranslate-XT</strong>\n&#9989; <strong>Personalization</strong> of search bar and autocomplete suggestions - labels, colors, preloader, image and more</p>\n\n<h4>Try the PRO version</h4>\n\n<p>FiboSearch also comes in a Pro version, with a modern, inverted index-based search engine. FiboSearch Pro works up to <strong>10 faster</strong> than the Free version or other popular search solutions for WooCommerce.</p>\n\n<p><a href=\"https://fibosearch.com/pricing/?utm_source=readme&amp;utm_medium=referral&amp;utm_content=pricing&amp;utm_campaign=asfw\">Upgrade to PRO and boost your sales!</a></p>\n\n<h4>PRO features</h4>\n\n<p>&#9989; <strong>Ultra-fast search engine</strong> based on the inverted index  works very fast, even with 100,000+ products\n&#9989; <strong>Fuzzy search</strong>  works even with minor typos\n&#9989; <strong>Search in custom fields</strong> with dedicated support for ACF\n&#9989; <strong>Search in attributes</strong>\n&#9989; <strong>Search in categories</strong>. Supports category thumbnails.\n&#9989; <strong>Search in tags</strong>\n&#9989; <strong>Search in brands</strong> (We support WooCommerce Brands, Perfect Brands for WooCommerce, Brands for WooCommerce, YITH WooCommerce Brands). Supports brand thumbnails.\n&#9989; <strong>Search by variation product SKU</strong>  also shows variable products in live search after typing in the exact matching SKU\n&#9989; <strong>Search for posts</strong>  also shows matching posts in live search\n&#9989; <strong>Search for pages</strong>  also shows matching posts in live search\n&#9989; <strong>Synonyms</strong>\n&#9989; <strong>Conditional exclusion of products</strong>\n&#9989; <strong>TranslatePress</strong> compatible\n&#9989; Professional and fast <strong>help with embedding</strong> or replacing the search bar in your theme\n&#9989; and more...\n&#9989; SEE ALL PRO <a href=\"https://fibosearch.com/pro-vs-free/?utm_source=readme&amp;utm_medium=referral&amp;utm_content=features&amp;utm_campaign=asfw\">FEATURES</a>!</p>\n\n<h4>Showcase</h4>\n\n<p>See how it works for others: <a href=\"https://fibosearch.com/showcase/?utm_source=readme&amp;utm_medium=referral&amp;utm_campaign=asfw&amp;utm_content=showcase&amp;utm_gen=utmdc\">Showcase</a>.</p>\n\n<h4>Feedback</h4>\n\n<p>Any suggestions or comments are welcome. Feel free to contact us via the <a href=\"https://fibosearch.com/contact/?utm_source=readme&amp;utm_medium=referral&amp;utm_campaign=asfw&amp;utm_content=contact&amp;utm_gen=utmdc\">contact form</a>.</p>\";s:12:\"installation\";s:398:\"<ol>\n<li>Install the plugin from within the Dashboard or upload the directory <code>ajax-search-for-woocommerce</code> and all its contents to the <code>/wp-content/plugins/</code> directory.</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress.</li>\n<li>Go to <code>WooCommerce  FiboSearch</code> and set your preferences.</li>\n<li>Embed the search bar in your theme.</li>\n</ol>\";s:3:\"faq\";s:4053:\"<h4>How do I embed the search bar in my theme?</h4>\n\n<p>There are many easy ways to display the FiboSearch bar in your theme:</p>\n\n<p> <strong>Replacing the existing search bar with one click</strong> - it is possible for dozens of popular themes\n <strong>As a menu item</strong> - in your WordPress admin panel, go to <code>Appearance  Menu</code> and add <code>FiboSearch bar</code> as a menu item\n <strong>Using a shortcode</strong></p>\n\n<pre><code>[fibosearch]\n</code></pre>\n\n<p> <strong>As a widget</strong> - in your WordPress admin panel, go to <code>Appearance  Widgets</code> and choose <code>FiboSearch</code>\n <strong>As a block</strong> - <a href=\"https://fibosearch.com/documentation/get-started/how-to-add-fibosearch-to-your-website/#add-fibosearch-with-the-dedicated-fibosearch-block\">learn how to use blocks</a> and FiboSearch together\n <strong>Using PHP</strong></p>\n\n<pre><code>&lt;?php echo do_shortcode(\'[fibosearch]\'); ?&gt;\n</code></pre>\n\n<p> <strong>We will do it for you!</strong> - we offer free search bar implementation for Pro users. Become one now!</p>\n\n<p>Or insert this function inside a PHP file (often, it is used to insert a form inside page template files):</p>\n\n<h4>How do I replace the existing search bar in my theme with FiboSearch?</h4>\n\n<p>We have prepared a one-click replacement of the search bar for the following themes:</p>\n\n<ul>\n<li>Storefront</li>\n<li>Divi</li>\n<li>Flatsome</li>\n<li>OceanWP</li>\n<li>Astra</li>\n<li>Avada</li>\n<li>Sailent</li>\n<li>and 43 more... See a complete list of integrated themes on <a href=\"https://fibosearch.com/documentation/themes-integrations/?utm_source=readme&amp;utm_medium=referral&amp;utm_campaign=asfw&amp;utm_content=theme-integrations\">our documentation</a>.</li>\n</ul>\n\n<p>If you want to replace your search bar in another theme, please <a href=\"https://fibosearch.com/contact/?utm_source=readme&amp;utm_medium=referral&amp;utm_campaign=asfw&amp;utm_content=contact&amp;utm_gen=utmdc\">contact our support team</a>.\nWe will assist with replacing the search bar in your theme for free after you upgrade to the Pro version.</p>\n\n<h4>Can I add the search bar as a WordPress menu item?</h4>\n\n<p><strong>Yes, you can!</strong> Go to <code>Appearance  Menu</code>. You will see a new menu item called FiboSearch. Select it and click Add to menu. Done!</p>\n\n<h4>How can I ask a question?</h4>\n\n<p>You can submit a ticket on the plugin <a href=\"https://fibosearch.com/contact/?utm_source=readme&amp;utm_medium=referral&amp;utm_campaign=asfw&amp;utm_content=contact&amp;utm_gen=utmdc\">website</a> and the support team will get in touch with you shortly. We also answer questions on the <a href=\"https://wordpress.org/support/plugin/ajax-search-for-woocommerce/\">WordPress Support Forum</a>.</p>\n\n<h4>Do you offer customization support?</h4>\n\n<p>Depending on the theme you use, sometimes the search bar requires minor improvements in appearance. We guarantee fast CSS corrections for all Pro plugin users, but we also help Free plugin users.</p>\n\n<h4>Where can I find plugin settings?</h4>\n\n<p>In your WordPress dashboard, go to <code>WooCommerce  FiboSearch</code>. The FiboSearch settings page is a submenu of the WooCommerce menu.</p>\n\n<h4>Who is the Pro plugin version for?</h4>\n\n<p>The Pro plugin version is for all online sellers looking to <strong>increase sales</strong> by providing an ultra-fast smart search engine to their clients.</p>\n\n<p>The main difference between the Pro and Free versions is search speed and search scope. The Pro version has a new fast smart search engine. For some online stores that offer a lot of products for sale, search speed can be increased <strong>up to 10</strong>, providing a whole new experience to end users.</p>\n\n<p>All in all, the Pro version is dedicated to all WooCommerce shops where autocomplete suggestions work too slowly.</p>\n\n<p>You can read more and compare Pro and Free features here: <a href=\"https://fibosearch.com/pro-vs-free/\">Full comparison - Pro vs Free</a>.</p>\";s:9:\"changelog\";s:41262:\"<h4>1.27.0, January 31, 2024</h4>\n\n<ul>\n<li>ADDED: Integration with the Betheme theme</li>\n<li>ADDED: Highlight words in search results with Greek letters regardless of accent</li>\n<li>ADDED: Support for Full-width Search in the XStore theme</li>\n<li>FIXED: Multiple search containers on mobile in the Astra theme integration</li>\n<li>FIXED: No focus on search input for mobile devices in the Astra theme integration</li>\n<li>FIXED: Allow an HTML <code>&amp;lt;i&amp;gt;</code> tag in suggestion titles and headlines</li>\n<li>FIXED: Multilingual support is active even for one language</li>\n<li>FIXED: Overriding the search icon and form in the header was not working properly in the WoodMart integration</li>\n<li>FIXED: Missing filters from Advanced AJAX Product Filters plugin in the Divi theme</li>\n<li>FIXED: Replace <code>&amp;#37</code> for more stable format <code>%%</code> in a <code>sprintf</code> function</li>\n<li>FIXED: An unwanted modal after closing the search overlay on mobile in the Flatsome theme</li>\n<li>FIXED: Missing colors after updating the Bloksy theme to 2.x</li>\n<li>FIXED: Incorrect calculation of a product\'s position in search results when it contains Greek letters</li>\n<li>FIXED: Incorrect term language detection in the WPML plugin. Replacing <code>term_id</code> with <code>term_taxonomy_id</code></li>\n<li><p>FIXED: Unwanted ampersand entity in the product description of search results</p></li>\n<li><p>UPDATED: Requires PHP: 7.4</p></li>\n<li>UPDATED: The <code>.pot</code> file</li>\n<li>UPDATED: Polish translation</li>\n<li>UPDATED: Freemius SDK v2.6.2</li>\n</ul>\n\n<h4>1.26.1, October 19, 2023</h4>\n\n<ul>\n<li>FIXED: Details panel - wrong HTML format of stock status element </li>\n</ul>\n\n<h4>1.26.0, October 17, 2023</h4>\n\n<ul>\n<li>ADDED: Integration with Bricks builder</li>\n<li><p>ADDED: Integration with Brizy builder</p></li>\n<li><p>FIXED: Calc score by comparing every word of the search phrase instead of all search phrase</p></li>\n<li>FIXED: WooCommerce Wholesale Prices plugin - invalid search results e.g. not hidden products and categories in the search results</li>\n<li>FIXED: Flatsome - when there are more search icons, only one is replaced</li>\n<li>FIXED: WPRocket - in some cases search fields/icons are not replaced immediately after the page load</li>\n<li><p>FIXED: Highlight matched words instead of the whole search phrase</p></li>\n<li><p>TWEAK: Allowing access to the <code>Personalization</code> class via <code>DGWT_WCAS()</code> function</p></li>\n<li><p>TWEAK: HUSKY - Products Filter Professional for WooCommerce plugin - disable the test in the Troubleshooting module for newer versions of this plugin</p></li>\n<li><p>REFACTOR: Replace <code>.click()</code> with <code>trigger(\'click\')</code>, <code>.focus()</code> with <code>trigger(\'focus\')</code>, <code>.blur()</code> with <code>trigger(\'blur\')</code></p></li>\n<li>REFACTOR: Replace <code>jQuery.fn.mouseup()</code> with <code>$(document).on(\'mouseup\')</code></li>\n<li>REFACTOR: Replace <code>jQuery.isFunction()</code> with <code>typeof fn === \'function\'</code></li>\n<li>UPDATED: Freemius SDK v2.5.12</li>\n</ul>\n\n<h4>1.25.0, July 06, 2023</h4>\n\n<ul>\n<li>ADDED: Possibility to search for taxonomy terms regardless of accents in a phrase or term name</li>\n<li><p>ADDED: Added some new filters to change URLs of results in autocomplete and details panel</p></li>\n<li><p>FIXED: Warnings due to <code>open_basedir</code> restrictions</p></li>\n<li>FIXED: Integration with the Impreza theme - broken AJAX pagination for Grid element</li>\n<li>FIXED: Integration with the TheGem theme - missing search results when the Layout Type option is set to Products Grid</li>\n<li>FIXED: Integration with the Divi theme - mobile overlay not showing up</li>\n<li><p>FIXED: Stronger sanitization of the details panel output</p></li>\n<li><p>UPDATED: Freemius SDK v2.5.10</p></li>\n<li>UPDATED: Polish translation</li>\n</ul>\n\n<h4>1.24.0, May 25, 2023</h4>\n\n<ul>\n<li>ADDED: Integration with the Minimog theme</li>\n<li>ADDED: Posts, pages, and taxonomy terms are included in the FiboSearch Analytics module</li>\n<li>ADDED: Taking into account a new feature of the dark theme in the Nave theme</li>\n<li>ADDED: Possibility to change the color of a search bar underlay. Only for the Pirx style</li>\n<li>ADDED: New search widget and extended search results for Elementor</li>\n<li><p>ADDED: TheGem theme - Header Builder support</p></li>\n<li><p>FIXED: Wrong position of search icons in the history search module</p></li>\n<li>FIXED: Broken suggestions layout and detailed panel visibility when the Minimum characters option is set to less than 1</li>\n<li>FIXED: Compatibility with PHP 8.1</li>\n<li>FIXED: Hide unnecessary modules when constant <code>DGWT_WCAS_ANALYTICS_ONLY_CRITICAL</code> is set to true in the FiboSearch Analytics module</li>\n<li>FIXED: Incorrect display of information about constants on the debug page</li>\n<li>FIXED: Other minor bugs in the FiboSearch Analytics module</li>\n<li>FIXED: Integration with the Astra theme - support for version 4.1.0 of the Astra Addon</li>\n<li>FIXED: Integration with the Minimog theme - wrong position of the search history wrapper</li>\n<li>FIXED: Integration with the Enfold theme - the search engine icon disappears when the page finishes loading</li>\n<li>FIXED: A HTML tag <code>&lt;br&gt;</code> was unnecessarily stripped in the description in the details panel</li>\n<li><p>FIXED: The voice search feature - overlapping icons and disabling functionality on Safari</p></li>\n<li><p>UPDATED: French translation</p></li>\n<li>UPDATED: Freemius SDK v2.5.8</li>\n<li>TESTS: Two integration tests that check saving phrases in a database table</li>\n<li>TESTS: Fix assertion in Analytics/Critical searches without result</li>\n<li>REFACTOR: Change order if set settings defaults. Now the defaults are set after calling the <code>dgwt/wcas/settings</code> filter</li>\n<li>SECURITY: Added escaping for a Search input placeholder option</li>\n</ul>\n\n<h4>1.23.0, April 05, 2023</h4>\n\n<ul>\n<li>ADDED: Integration with the Blocksy theme</li>\n<li>ADDED: Integration with the Qwery theme</li>\n<li>ADDED: Integration with the StoreBiz theme</li>\n<li>ADDED: Allows the <code>Shop manager</code> role to manage the plugin settings by adding a constant to the <code>wp.config.php</code> file</li>\n<li><p>ADDED: Allows creating HTML templates instead of displaying simple No results message</p></li>\n<li><p>IMPROVED: Blocks calculating score if the phrase contains a single character</p></li>\n<li>FIXED: More accurate calculation of the order of products in search results. The extra score for an exact match of a sequence of words</li>\n<li>FIXED: Storefront theme - not working focus event while using a mobile overlay for iPhone devices</li>\n<li>FIXED: Mobile overlay on iPhone devices - didn\'t hide search results on a scroll event or after clicking the done button</li>\n<li>FIXED: iPhone devices - annoying auto zoom in search input on focus</li>\n<li>FIXED: Search icon mode and search history - a search bar was needlessly concealed on clicking the Clear button</li>\n<li>FIXED: Freemius SDK - added submenu slug</li>\n<li>FIXED: Flatsome theme - detecting incompatible settings and disappearing search form on hover</li>\n<li>FIXED: Layout option - hidden triangle icon when a layout is icon and style is Pirx</li>\n<li><p>FIXED: Unnecessary AJAX query on the settings page</p></li>\n<li><p>TWEAK: Replacing empty href tag with <code>#</code> in Storefront integration because of SEO</p></li>\n<li><p>TWEAK: Trivial CSS changes</p></li>\n<li><p>UPDATED: Freemius SDK to v2.5.6</p></li>\n<li><p>REFACTOR: Forcing mobile overlay breakpoint and in layout breakpoint in theme integrations</p></li>\n<li>REFACTOR: Variables names in the method <code>Helpers::calcScore()</code></li>\n</ul>\n\n<h4>1.22.3, January 30, 2023</h4>\n\n<ul>\n<li>FIXED: Some prices were not aligned properly</li>\n</ul>\n\n<h4>1.22.0, January 30, 2023</h4>\n\n<ul>\n<li>ADDED: New feature - Search history. The current search history is presented when the user clicked/taped on the search bar, but hasn\'t yet typed the query.</li>\n<li>ADDED: FiboSearch Analytics - New widget in WordPress Dashboard with critical searches without result</li>\n<li>ADDED: Integration with Essentials theme</li>\n<li>ADDED: Make UI_FIXER object as global object</li>\n<li>ADDED: Ability to search for vendors by description and city</li>\n<li>ADDED: Ability to exclude critical phrases in the Analytics module</li>\n<li>ADDED: Custom JavaScript events during the search process</li>\n<li>ADDED: Ability to export search analytics data as CSV files</li>\n<li>FIXED: Integration with Flatsome theme - focus event didn\'t work with a search bar</li>\n<li>FIXED: Integration with WooCommerce Product Filter by WooBeWoo - Undefined array key \'query\' notice</li>\n<li>FIXED: Integration with Jet Smart Menu - repair duplicated search bars IDs</li>\n<li>FIXED: Integration with Astra theme - support for version 4.0.0</li>\n<li>FIXED: Integration with Astra theme - cannot change the number of products on the cart page</li>\n<li>FIXED: Integration with XStore theme - support for search icon in mobile panel</li>\n<li>FIXED: Compatibility with PHP 8.1</li>\n<li>FIXED: RWD for FiboSearch Settings views including Analytics views</li>\n<li>FIXED: Search bar CSS, especially when Pirx style and Voice Search work together</li>\n<li><p>FIXED: A user with permission to edit plugin settings cannot see search analytics</p></li>\n<li><p>CHANGE: Updated French translation</p></li>\n<li>CHANGE: Hide the Voice Search icon when a user starts typing</li>\n<li>CHANGE: Updated Freemius SDK to v2.5.3</li>\n<li>CHANGE: Remove information that Analytics is a beta feature</li>\n<li>CHANGE: Remove information that Darkened Background is a beta feature</li>\n<li>CHANGE: Set \"Pirx\" as a default search bar style</li>\n</ul>\n\n<h4>1.21.0, November 21, 2022</h4>\n\n<ul>\n<li>ADDED: Integration with Product GTIN (EAN, UPC, ISBN) for WooCommerce plugin</li>\n<li>ADDED: Integration with EAN for WooCommerce plugin</li>\n<li><p>ADDED: Troubleshooting - checks if products thumbnails need to be regenerated</p></li>\n<li><p>FIXED: Missing translation domain in some texts</p></li>\n<li>FIXED: Support variants of &lt;br&gt; tag in product names in autocomplete</li>\n<li>FIXED: Unable to embed search bar as a widget</li>\n<li>FIXED: Disable voice search for Chrome on iPhone or iPad</li>\n<li>FIXED: Integration with the Astra theme - unclosed  &lt;div&gt; tag</li>\n<li>FIXED: Exclude save phrases to analyze when the phrase is \'fibotests\' or the user has a specific role.</li>\n<li>FIXED: UI_FIXER: check if event listeners were correctly added to search inputs. If no, reinitiate the search instance</li>\n<li>FIXED: UI_FIXER: rebuild all search bars without correct JS events</li>\n<li><p>FIXED: Redundant DB queries related to the existence of plugin tables</p></li>\n<li><p>CHANGE: Updated Freemius SDK to v2.5.2</p></li>\n</ul>\n\n<h4>1.20.0, September 13, 2022</h4>\n\n<ul>\n<li>ADDED: Integration with Woostify theme</li>\n<li>ADDED: Integration with Neve theme</li>\n<li>ADDED: Integration with WP Rocket</li>\n<li>ADDED: Include block sources in the plugin package</li>\n<li>ADDED: Possibility to reset search statistics from the settings page</li>\n<li><p>ADDED: Support for &lt;sub&gt; element in autocomplete suggestions</p></li>\n<li><p>FIXED: Incorrect display of styles with personalization of the search</p></li>\n<li>FIXED: Wrong settings index in Impreza and Enfold theme</li>\n<li>FIXED: Removed of unnecessary language files</li>\n<li>FIXED: Always set cursor at the end of the input</li>\n<li>FIXED: Incorrect verification if the browser supports speech recognition</li>\n<li>FIXED: FiboSearch Analytics - not working check buttons of the latest loading list</li>\n<li>FIXED: Unnecessary options and transients after uninstalling plugin</li>\n</ul>\n\n<h4>1.19.0, July 27, 2022</h4>\n\n<ul>\n<li>ADDED: New feature - New search layout called Pirx</li>\n<li>ADDED: New feature - FiboSearch Analytics</li>\n<li>ADDED: New feature - Layout type: Icon on desktop, search bar on mobile</li>\n<li>ADDED: New feature - Voice search</li>\n<li>ADDED: New feature - FiboSearch blocks in the block editor</li>\n<li>ADDED: Separated option mobile_overlay_breakpoint to handle overlay on mobile breakpoint</li>\n<li>ADDED: Add \"mobile_overlay_breakpoint\" as a shortcode param to add the opportunity to set this value independently from global settings</li>\n<li>ADDED: New search bars fixer: try to regenerate search bars when they were added by AJAX callbacks</li>\n<li>ADDED: Support for header builder in integration with Astra theme</li>\n<li>ADDED: Another question marks for FiboSearch settings that cover our documentation</li>\n<li>ADDED: Settings preview - smooth scrolling</li>\n<li>ADDED: Settings preview - animate typing on a search preview for Search bar tab</li>\n<li>ADDED: Support all types of layout in widget and embedding via Menu</li>\n<li>ADDED: Ability to reset plugin settings to default values</li>\n<li><p>ADDED: New shortcode params: submit_btn and submit_text</p></li>\n<li><p>FIXED: WOOF  Products Filter for WooCommerce integration: broken counters on the search results page</p></li>\n<li>FIXED: Interdependent settings in Settings -> Search bar -> Style -> Design</li>\n<li>FIXED: Improved darkened background positioning (support for sticky elements as well)</li>\n<li>FIXED: Improved search suggestions and the details panel positioning (support for sticky elements as well)</li>\n<li>FIXED: Settings page - wrong position of a questions mark (Safari)</li>\n<li>FIXED: JavaScript errors in the settings page when the GeoTargetingWP plugin is active</li>\n<li>FIXED: Try to add dgwt-wcas-active class again if it has not been added by other events</li>\n<li>FIXED: Incorrect elements position after load iconMode</li>\n<li>FIXED: Incorrect adding CSS class as shortcode parameter</li>\n<li><p>FIXED: English grammar typos</p></li>\n<li><p>CHANGE: Updated Freemius SDK to v2.4.4</p></li>\n<li>REFACTOR: Indexer - Replacing PDO with WPDB</li>\n<li>REFACTOR: Settings page - rebuild the settings section Search Bar -> Appearance to improve UX</li>\n<li>REFACTOR: Search bars fixer</li>\n</ul>\n\n<h4>1.18.1, May 23, 2022</h4>\n\n<ul>\n<li>FIXED: Exceeding the memory limit on the search results page</li>\n</ul>\n\n<h4>1.18.0, May 12, 2022</h4>\n\n<ul>\n<li>ADDED: New feature - FiboSearch Analytics. This feature will be available to everyone in FiboSearch v1.19.0. To enable it in v1.18.0 declare constant <code>define( \'DGWT_WCAS_ANALYTICS_ENABLE\', true );</code> in <code>wp-config.php</code></li>\n<li>ADDED: Open selected suggestion in new tab by shortcut Cmd+Enter/Ctrl+Enter</li>\n<li>ADDED: Show score in search results on the Debug page</li>\n<li><p>ADDED: Link darkened background and fuzzy search feature to the documentation</p></li>\n<li><p>FIXED: Improving ESC key functionality: If there are suggestions, ESC hides them. If there are not suggestions and mobile icon mode is enabled, ESC disables mobile icon mode. If there are not suggestions and darkened overlay is enabled, ESC disables darkened overlay</p></li>\n<li>FIXED: Allow recognizing CMD key</li>\n<li>FIXED: Remove interaction on the TAB key</li>\n<li>FIXED: Elementor popups - reinit search bars after loading Elementor\'s popup</li>\n<li>FIXED: Cannot open the first result with Ctrl + Enter</li>\n<li>FIXED: Prevent displaying search results, if the search icon mode is closed</li>\n<li>FIXED: Unnecessary closing mobile icon mode and darkened overlay mode after selecting text in the search bar. It used to happen often when users selected text from the search bar to remove it and write something new but clicked outside the search bar (JS mouseup event was outside the bar)</li>\n<li><p>FIXED: Better sanitization of the plugin settings</p></li>\n<li><p>FACTOR: Retrieving results on the search page without additional HTTP request</p></li>\n</ul>\n\n<h4>1.17.0, February 28, 2022</h4>\n\n<ul>\n<li>ADDED: New beta feature - Darkened background</li>\n<li>ADDED: Integration with Kadence theme</li>\n<li>ADDED: Integration with TheGem (Elementor) and renamed TheGem (WPBakery)</li>\n<li>ADDED: Comments in template files for the Details Panel</li>\n<li>ADDED: Refreshing the content on the checkout page when a product is added to the cart from the search Details Panel</li>\n<li>ADDED: Tooltip with information about overriding when an option is overridden by theme integration</li>\n<li>FIXED: Conflict between Salient theme and Shipmondo plugin</li>\n<li>FIXED: Unexpected hiding from the search bar right after the focus event. Bug occurred only on mobiles</li>\n<li>FIXED: Hide the Storefront handheld footer bar when the search results are open. Otherwise, handheld footer bar covers the autocomplete dropdown</li>\n<li>FIXED: Prevent toggle mobile overlay if the search bar doesn\'t have this mode</li>\n<li>FIXED: Non-existing table during the database repair process</li>\n<li>FIXED: Minor security issues</li>\n<li>FIXED: Fatal errors in PHP 8 when the dashboard language is set to ru_RU</li>\n<li>FIXED: Add artificial overlay to cover the Close Button because SVG elements don\'t provide information about parents elements in \"event.target\"</li>\n<li>CHANGE: General tooltip style on the plugin settings page - more padding, bigger font, right position of the tooltip, auto cursor, wider</li>\n</ul>\n\n<h4>1.16.0, February 03, 2022</h4>\n\n<ul>\n<li>ADDED: Integration with a XStore theme</li>\n<li>ADDED: Allow customization of the Details Panel with actions and filters</li>\n<li>ADDED: Templating system to override details panel templates via child-theme</li>\n<li>ADDED: Troubleshooting - test if product translations are enabled in the Polylang settings</li>\n<li><p>ADDED: Add extra CSS classes when search bar is focused</p></li>\n<li><p>FIXED: Compatibility with PHP 8.1</p></li>\n<li>FIXED: Integration with Astra theme - the Save Changes button disappeared after turning on the integration</li>\n<li>FIXED: JavaScript errors on the plugin activation page</li>\n<li>FIXED: Bug with enabling and disabling overlay on mobile feature during window resizing and reaching a breakpoint</li>\n<li>FIXED: Missing \"Troubleshooting\" tab icon with the number of issues</li>\n</ul>\n\n<h4>1.15.0, December 16, 2021</h4>\n\n<ul>\n<li>ADDED: Integration with a Uncode theme</li>\n<li>ADDED: Integration with Uncode theme - support for dark menu skin</li>\n<li>ADDED: Possibility to submit the search event to Google Analytics in your own way</li>\n<li>ADDED: Basic support for AMP</li>\n<li><p>ADDED: Allow getting search results programmatically</p></li>\n<li><p>FIXED: Integration with the Goya theme has stopped working</p></li>\n<li>FIXED: Divi theme integration - overlay on mobile was fixed. Support for new Divi ID #et_top_search_mob</li>\n<li>FIXED: Divi theme integration - search form did not disappear after exiting mobile overlay</li>\n<li>FIXED: Search suggestions were invisible because of a bug in the old version of jQuery UI. The method outerHeight() returned an object instead of a number</li>\n<li><p>FIXED: Simplifying integration with Polylang</p></li>\n<li><p>CHANGE: Remove info about rebranding</p></li>\n</ul>\n\n<h4>1.14.0, October 19, 2021</h4>\n\n<ul>\n<li>ADDED: Integration with GeneratePress theme</li>\n<li>ADDED: Possibility to set a delay for initialization of mobile overlay</li>\n<li>ADDED: New filter to manipulate the results score</li>\n<li>ADDED: Details Panel - support for responsive images including retina images (2x), sizes, and srcset</li>\n<li>ADDED: Possibility to insert custom HTML in 5 places in the search suggestion</li>\n<li><p>ADDED: New filter and action hooks</p></li>\n<li><p>FIXED: Prevent hiding search results on click an Enter key when submit is disabled via a filter</p></li>\n<li>FIXED: No results on the search page when WPML is active with Language name added as a parameter option</li>\n<li>FIXED: Support for version v1.3.1 of Open Shop theme</li>\n<li>FIXED: Integrating with Divi theme - delay in starting JS scripts</li>\n<li>FIXED: Integrating with Divi theme - force search overlay for mobile devices</li>\n<li>FIXED: Unnecessary HTML tags in the search input after selecting a suggestion</li>\n<li>FIXED: Hide mobile overlay after submitting a form or clicking a result. Fixes screen after clicking iPhone back arrow</li>\n<li>FIXED: Troubleshooting module. Fixed false negative in OutOfStockRelationships test. An order of arrays was taken into account for the diff function. It was replaced by full diff</li>\n<li>FIXED: Unclosed tag &lt;a/&gt;</li>\n<li>FIXED: Typo on Troubleshooting tab</li>\n<li><p>FIXED: Clear alt attribute in the product thumbnail</p></li>\n<li><p>REFACTOR: Escape search terms the way WordPress core does</p></li>\n<li>REFACTOR: Replacing image with thumbnails in DgoraWcas\\Post class to keep a consistent style compared with DgoraWcas\\Product</li>\n</ul>\n\n<h4>1.13.0, July 27, 2021</h4>\n\n<ul>\n<li>ADDED: Integration with eStore theme</li>\n<li><p>ADDED: Allow to open search result in new tab with Ctrl+left mouse key</p></li>\n<li><p>FIXED: Disappearing suggestions and details panel on click when there were more search bars.</p></li>\n<li>FIXED: Improved integration with Avada theme</li>\n<li>FIXED: Improved mobile search in new version of Rehub theme</li>\n<li>FIXED: Unable to use context menu and middle mouse button on search results</li>\n<li><p>FIXED: Eletro theme - Support cases when the search overlay is disabled</p></li>\n<li><p>REFACTOR: Clean up composer files</p></li>\n</ul>\n\n<h4>1.12.0, June 22, 2021</h4>\n\n<ul>\n<li>ADDED: Integration with Electro theme</li>\n<li>ADDED: New test for the troubleshooting module - test language codes</li>\n<li><p>ADDED: New test for the troubleshooting module - check if the Elementor Pro has defined correct template for search results</p></li>\n<li><p>FIXED: WOOF  Products Filter for WooCommerce - disappearing filters if Dynamic recount and Hide empty terms was enabled and other issues</p></li>\n<li>FIXED: Remove unnecessary AJAX request on select See all products ... (X)</li>\n<li><p>FIXED: The search form is now generated without random ID, to be compatible with the LiteSpeed Cache plugin</p></li>\n<li><p>REFACTOR: Change .dgwt-wcas-suggestion element from &lt;div&gt; to &lt;a&gt; to allow open a suggestion in a new tab</p></li>\n</ul>\n\n<h4>1.11.0, May 24, 2021</h4>\n\n<ul>\n<li>ADDED: Integration with Goya theme</li>\n<li>ADDED: Integration with Top and Top Store Pro theme</li>\n<li>ADDED: Keep the state of a details panel in memory instead of replacing it every time using jQuery.html() method. Doesn\'t clear quantity and \"add to cart\" states.</li>\n<li><p>ADDED: Prevent submit empty form</p></li>\n<li><p>FIXED: W3 validator warning: The type attribute for the style element is not needed and should be omitted.</p></li>\n<li>FIXED: Search terms with apostrophes</li>\n<li>FIXED: Synchronization with the native WooCommerce option \"Out of stock visibility\" </li>\n<li>FIXED: Hiding an unnecessary line in the product details when there is no description</li>\n<li>FIXED: Adding polyfill for supporting includes in Internet Explorer 11</li>\n<li>FIXED: Better elements positioning on the \"Starting\" tab on the plugin settings page</li>\n<li>FIXED: Support for custom Google Analytics object name</li>\n<li>FIXED: Better handling plus and minus buttons for a quantity field</li>\n<li>FIXED: Uncaught Error: Call to a member function get_review_count() on null</li>\n<li>FIXED: Displaying the search box off screen on mobile devices</li>\n<li>FIXED: Correct way for rebuilding autocomplete feature on an input by manually recalling dgwtWcasAutocomplete(). Remove more events on dispose method</li>\n<li>FIXED: Highlight single chars in autocomplete results</li>\n<li>FIXED: Add trim on query value</li>\n<li>FIXED: Clear search title and phrase from escape characters</li>\n</ul>\n\n<h4>1.10.0, April 22, 2021</h4>\n\n<ul>\n<li>ADDED: Possibility to disable select event on suggestions (click and hit the Enter key)</li>\n<li><p>ADDED: Possibility to disable submit a search form via a filter</p></li>\n<li><p>FIXED: Not working click event on suggestions after using back arrow on a Safari browser</p></li>\n<li>FIXED: Allow to recognize Chinese lang codes such as zh-hant and zh-hans</li>\n<li>FIXED: Error on PHP 8. Wrong format for printf function</li>\n<li>FIXED: When searching for something and then clicking back arrow, the  for closing remained</li>\n<li>FIXED: Wrong path in restoration theme</li>\n<li>FIXED: Better checking of nonces</li>\n</ul>\n\n<h4>1.9.0, March 15, 2021</h4>\n\n<ul>\n<li><p>ADDED: Support for WooCommerce Private Store plugin</p></li>\n<li><p>CHANGE: Plugin rebranding -  Replace the plugin name AJAX Search for WooCommerce with new name FiboSearch</p></li>\n<li>CHANGE: Plugin rebranding -  Replace the old domain ajaxsearch.pro with new fibosearch.com</li>\n<li>CHANGE: Plugin rebranding -  Update visual assets </li>\n<li>CHANGE: Updated Freemius SDK to v2.4.2</li>\n<li>CHANGE: New alternate shortcode [fibosearch] instead of [wcas-search-form]</li>\n<li>CHANGE: Min supported version of PHP is 7.0</li>\n<li>FIXED: Fixed Chrome lighthouse insights</li>\n<li>FIXED: Missing of dgwt-wcas-active class when the search was focused too early</li>\n<li>FIXED: Grammar and spelling errors in texts</li>\n<li><p>FIXED: Not firing jQuery onLoad event for some browsers</p></li>\n<li><p>REMOVE: Removed useless dgwt-wcas-search-submit name attribute</p></li>\n<li>REMOVE: Removed unused search forms from a Avada theme</li>\n</ul>\n\n<h4>1.8.2, February 06, 2021</h4>\n\n<ul>\n<li>ADDED: Support for Astra theme</li>\n<li>ADDED: Support for Avada theme - replacing a fusion search form</li>\n<li>ADDED: Support for Open Shop theme</li>\n<li>ADDED: Support for Divi - menu in custom header and hiding search results when opening a search overlay</li>\n<li>ADDED: Support for CiyaShop theme</li>\n<li>ADDED: Support for BigCart theme</li>\n<li>FIXED: Increase the clickable area of the \'back button\' in the overlay mobile mode</li>\n<li>FIXED: Disappearing search bar especially on Firefox</li>\n<li>FIXED: Hide new aggressive admin notices added by other plugins</li>\n<li>FIXED: Hide shortcodes in the Details Panel</li>\n<li>FIXED: Divi theme integration - Prevent to focus input if it isn\'t empty. Fix case with more search bars in #main-header selector</li>\n<li>FIXED: Adaptation to the new class name convention of WooCommerce Product Table plugin</li>\n<li>FIXED: Fixed display of category names and tags in the Details Panel when the name contains an apostrophe</li>\n</ul>\n\n<h4>1.8.1, December 04, 2020</h4>\n\n<ul>\n<li>ADDED: Support for Rehub theme</li>\n<li>ADDED: Support for Supro theme</li>\n<li>FIXED: Troubleshooting module improvements</li>\n<li>FIXED: Blinking suggestions</li>\n<li>FIXED: Bug in icon colors</li>\n<li>FIXED: Flatsome theme - quantity buttons issue</li>\n<li>FIXED: Divi theme - hide extra search bar in footer</li>\n<li>FIXED: Mobile overlay improvements for iPhones</li>\n<li>FIXED: Better suggestion order for non latin letters</li>\n<li>FIXED: Action URL in search form when Polylang is active</li>\n<li>REMOVE: Mobile Detect library </li>\n</ul>\n\n<h4>1.8.0, October 23, 2020</h4>\n\n<ul>\n<li>ADDED: Support for Sober theme</li>\n<li>ADDED: Support for Divi theme</li>\n<li>ADDED: Support for Block Shop theme</li>\n<li>ADDED: Support for Enfold theme</li>\n<li>ADDED: Support for Restoration theme</li>\n<li>ADDED: Support for Salient theme</li>\n<li>ADDED: Support for Konte theme</li>\n<li>ADDED: New filter and action hooks</li>\n<li>ADDED: &lt;br&gt; to HTML whitelist for search suggestions</li>\n<li>ADDED: Allow to add search icon as menu item</li>\n<li>ADDED: Allow to change colors of search icon</li>\n<li>CHANGE: Updated Freemius SDK to v2.4.1</li>\n<li>CHANGE: Replace old close \"x\" icon with Material Design icons</li>\n<li>FIXED: Empty search results on search results page </li>\n<li>FIXED: Support Touchpad click for some devices</li>\n<li>FIXED: Mixed Content on the plugin settings page in some cases</li>\n<li>FIXED: Integration with Flatsome theme</li>\n<li>FIXED: Broken translations via WPML String Translation</li>\n</ul>\n\n<h4>1.7.2, July 12, 2020</h4>\n\n<ul>\n<li>ADDED: Integration with FacetWP plugin</li>\n<li>ADDED: Support for Shopkeeper theme</li>\n<li>ADDED: Support for The7 theme</li>\n<li>ADDED: Support for Avada theme</li>\n<li>ADDED: Support for Shop Isle theme</li>\n<li>ADDED: Support for Shopical theme</li>\n<li>ADDED: Support for Ekommart theme</li>\n<li>ADDED: Support for Savoy theme</li>\n<li>ADDED: Support for Sober theme</li>\n<li>ADDED: Support for Bridge theme</li>\n<li>ADDED: Possibility to change search icon color</li>\n<li>ADDED: New filter hook for a search form value</li>\n<li>ADDED: Support for Site Search module in Google Analytics</li>\n<li>FIXED: Add CSS border-box for each elements in search bar, suggestions and details panel</li>\n<li>FIXED: Sending events to Google Tag Manager</li>\n<li>FIXED: Remove &lt;b&gt; from product title</li>\n<li>FIXED: Search in categories and tags for Russian terms</li>\n<li>FIXED: Duplicated category in breadcrumb</li>\n<li>FIXED: No results when searching for phrase included apostrophe or double quote</li>\n<li>FIXED: Details panel - Remove HTML from titles attribute</li>\n<li>FIXED: Fixed for integration with Woo Product Filter plugin by WooBeWoo</li>\n<li>FIXED: Fixed for integration with XforWooCommerce plugin</li>\n<li>FIXED: Error: Undefined index: is_taxonomy in some cases</li>\n</ul>\n\n<h4>1.7.1, May 17, 2020</h4>\n\n<ul>\n<li>FIXED: Selecting suggestions issue</li>\n</ul>\n\n<h4>1.7.0, May 17, 2020</h4>\n\n<ul>\n<li>ADDED: Icon search instead of search bar (beta)</li>\n<li>ADDED: Improvements on search results pages</li>\n<li>ADDED: Integration with native WooCommerce filters</li>\n<li>ADDED: Integration with Advanced AJAX Product Filters plugin by BeRocket</li>\n<li>ADDED: Integration with WOOF  Products Filter for WooCommerce plugin by realmag777</li>\n<li>ADDED: Integration with Product Filters for WooCommerce plugin by Automattic developed by Nexter</li>\n<li>ADDED: Integration with Woo Product Filter plugin by WooBeWoo</li>\n<li>ADDED: Integration with WooCommerce Product Table plugin by Barn2 media</li>\n<li>ADDED: Support for TheGem theme</li>\n<li>ADDED: Support for Impreza theme</li>\n<li>ADDED: Support for Medicor theme</li>\n<li>ADDED: Support for WoodMart theme</li>\n<li>ADDED: Support for Polylang</li>\n<li>ADDED: New filter and action hooks</li>\n<li>ADDED: Dynamically loaded prices for WPML Multi-currency feature</li>\n<li>FIXED: Mobile search - don\'t hide suggestions on blur</li>\n<li>FIXED: Bug related to highlight keywords. For some cases it displayed &lt;strong&gt; tag.</li>\n<li>FIXED: Delay on mouse hover effect</li>\n<li>FIXED: Minor CSS improvements</li>\n<li>FIXED: Broken mobile view on cart page in some cases</li>\n</ul>\n\n<h4>1.6.3, March 11, 2020</h4>\n\n<ul>\n<li>ADDED: Details panel - display stock quantity</li>\n<li>FIXED: Better support for the Elementor including popups and sticky menu</li>\n<li>FIXED: Better support for page builders. Late initialization.</li>\n<li>FIXED: Disabling automatic regenerate thumbnails. Conditionally images regeneration.</li>\n<li>FIXED: HTTP 500 on getResultDetails for some cases</li>\n<li>FIXED: Too long description in live suggestions</li>\n<li>FIXED: Add non-breaking space for prices</li>\n<li>FIXED: JS errors Failed to execute \'getComputedStyle\' on \'Window\' (for some cases)</li>\n<li>CHANGE: Rename jQuery object from Autocomplete to DgwtWcasAutocompleteSearch because of namespaces conflicts</li>\n</ul>\n\n<h4>1.6.2, February 18, 2020</h4>\n\n<ul>\n<li>ADDED: Details Panel - new layout for product overview and other UX improvements</li>\n<li><p>ADDED: Automatically regenerates images after first plugin activation</p></li>\n<li><p>FIXED: Highlighted no results suggestion</p></li>\n<li>FIXED: Better security</li>\n</ul>\n\n<h4>1.6.1, January 26, 2020</h4>\n\n<ul>\n<li>ADDED: Details Panel - grouped load, faster load</li>\n<li>ADDED: New way to embed search box - embedding by menu</li>\n<li>ADDED: Details panel - show \"more products...\" link for taxonomy type suggestion</li>\n<li>ADDED: Add &lt;form&gt; to quantity elements in a details panel</li>\n<li><p>ADDED: New filters and actions hook</p></li>\n<li><p>FIXED: Issue related to colors in plugin settings</p></li>\n<li>FIXED: Suggestions groups - improved limits</li>\n<li>FIXED: Pricing for taxonomy term in a details panel</li>\n<li>FIXED: Show a details panel on keys UP and DOWN</li>\n<li>FIXED: Mobile search overlay - block scroll of &lt;html&gt; tag (issue on iPhones)</li>\n<li>FIXED: Better data-wcas-context ID, bypasses opcache</li>\n<li>FIXED: W3C - Accessibility errors</li>\n<li>FIXED: Storefront mobile search - more time for input autofocus</li>\n<li>FIXED: Disable quantity for Astra Pro theme - there were broken buttons</li>\n<li><p>FIXED: Minor CSS improvements</p></li>\n<li><p>CHANGE:  Decrease debounce time for better speed effect</p></li>\n<li>CHANGE: Updated Freemius SDK v2.3.2</li>\n</ul>\n\n<h4>1.6.0, December 08, 2019</h4>\n\n<ul>\n<li>ADDED: Suggestions groups</li>\n<li>ADDED: Hide advanced settings</li>\n<li>ADDED: Better grouping of settings</li>\n<li>ADDED: Support for Google Analytics events</li>\n<li>ADDED: Search bar preview in settings</li>\n<li>ADDED: New action and filters hooks</li>\n<li>FIXED: Flatsome theme support for [search] shortcode</li>\n<li>FIXED: Images in details panel</li>\n<li>CHANGE: Updated Freemius SDK</li>\n<li>REMOVE: Remove ontouch event from mobile detect</li>\n</ul>\n\n<h4>1.5.0, September 16, 2019</h4>\n\n<ul>\n<li>ADDED: Integration with the Flatsome theme. It is possible to replace the Flatsome search form via one checbox in the plugin settings page.</li>\n<li>FIXED: Overload servers. Optimalization for chain AJAX requests. Creates a debounced function that delays invoking func until after wait milliseconds have elapsed since the last time the debounced function was invoked</li>\n<li>FIXED: Better support for HTML entities in products title and description</li>\n<li>FIXED: Issues with mobile search version on Storefront theme for iPhones</li>\n<li>CHANGE: Update/sync fork of devbridge/jQuery-Autocomplete to the latest version</li>\n<li>CHANGE: Settings design</li>\n</ul>\n\n<h4>1.4.1, August 05, 2019</h4>\n\n<ul>\n<li>ADDED: French translations</li>\n<li>FIXED: Better support for fixed menu</li>\n<li>FIXED: Add box-sizing to the search input to better implementation for some themes</li>\n<li>FIXED: Duplicated class Mobile_Detect in some cases</li>\n<li>FIXED: Submit button position in some cases</li>\n<li>FIXED: Zoom in iPhones on focused input</li>\n<li>FIXED: Size of images for categories and tags in the Details panel</li>\n<li>CHANGE: Updated Freemius SDK</li>\n</ul>\n\n<h4>1.4.0, May 04, 2019</h4>\n\n<ul>\n<li>ADDED: New modern mobile search UX (beta, disabled by default, enabled only for Storefront theme)</li>\n<li>ADDED: Italian translations</li>\n<li>ADDED: Spain translations</li>\n<li>FIXED: Error with WP Search WooCommerce Integration</li>\n<li>FIXED: Conflict with the Divi theme for some cases</li>\n<li>CHANGE: Implementing flexbox grid (CSS)</li>\n</ul>\n\n<h4>1.3.3, March 02, 2019</h4>\n\n<ul>\n<li>FIXED: Deactivate browser native \"X\" icon for search input</li>\n<li>FIXED: Products images for tags and categories in Details panel</li>\n<li>FIXED: Security fix</li>\n<li>ADDED: New logos</li>\n<li>CHANGE: Updated Freemius SDK</li>\n</ul>\n\n<h4>1.3.2, February 16, 2019</h4>\n\n<ul>\n<li>ADDED: The text \"No results\" and \"See all results...\" can be customized in the plugin settings</li>\n<li>ADDED: New filters and hooks</li>\n<li>FIXED: Hide the \"Account\" link in the free plugin versions</li>\n<li>FIXED: The error with the appearance of the tags suggestion</li>\n<li>FIXED: Problem with artificially duplicated search forms occurred in the Mega Menu plugin and some themes.</li>\n<li>CHANGE: Enforcing use \"box-sizing: border-box\" within the search form</li>\n<li>CHANGE: Updated Freemius SDK</li>\n</ul>\n\n<h4>1.3.1, January 06, 2019</h4>\n\n<ul>\n<li>FIXED: PHP error with widget</li>\n</ul>\n\n<h4>1.3.0, January 06, 2019</h4>\n\n<ul>\n<li>ADDED: If there are more results than limit, the \"See all results...\" link will appear</li>\n<li>ADDED: Information about the PRO features</li>\n<li>ADDED: Breadcrumbs for nested product categories</li>\n<li>FIXED: Better synchronization between the ajax search results and the search page</li>\n<li>FIXED: Improvements in the scoring system</li>\n<li>FIXED: Image placeholder for products without image</li>\n<li>FIXED: Add SKU label translatable in the suggestions</li>\n<li>CHANGE: Updated Freemius SDK</li>\n</ul>\n\n<h4>1.2.1, October 26, 2018</h4>\n\n<ul>\n<li>ADDED: Storefront support as a option. Allows to replace the native Storefront search form</li>\n<li>FIXED: Improving the relevance of search results by adding score system</li>\n<li>FIXED: Problem with too big images is some cases</li>\n<li>FIXED: Support for HTML entities in the search results</li>\n<li>FIXED: Bugs with the blur event on mobile devices</li>\n</ul>\n\n<h4>1.2.0, August 24, 2018</h4>\n\n<ul>\n<li>ADDED: Backward compatibility system</li>\n<li>ADDED: Support of image size improvements in Woocommerce 3.3</li>\n<li>ADDED: Dynamic width of the search form</li>\n<li>ADDED: Option to set max width of the search form</li>\n<li>ADDED: DISABLE_NAG_NOTICES support for admin notices</li>\n<li>ADDED: More hooks for developers</li>\n<li>ADDED: Minified version of CSS and JS</li>\n<li>ADDED: Label for taxonomy suggestions</li>\n<li>ADDED: Quantity input for a add to cart button in the Details panel</li>\n<li>FIXED: Problem with covering suggestions by other HTML elements of themes.</li>\n<li>FIXED: Details panel in RTL</li>\n<li>FIXED: Improvements for the IE browser</li>\n<li>CHANGE: Code refactor for better future development. Composer and PSR-4 support (in part).</li>\n<li>CHANGE: Better settings organization</li>\n<li>CHANGE: Updated Freemius SDK</li>\n</ul>\n\n<h4>1.1.7, April 22, 2018</h4>\n\n<ul>\n<li>FIXED: Removed duplicate IDs</li>\n<li>CHANGE: PHP requires tag set to PHP 5.5</li>\n<li>CHANGE: Woocommerce requires tags</li>\n<li>CHANGE: Updated Freemius SDK</li>\n<li>REMOVE: Removed uninstall.php</li>\n</ul>\n\n<h4>1.1.6, October 01, 2017</h4>\n\n<ul>\n<li>FIXED: Disappearing some categories and tags in suggestions</li>\n<li>FIXED: Hidden products were shown in search</li>\n</ul>\n\n<h4>1.1.5, September 05, 2017</h4>\n\n<ul>\n<li>ADDED: Requires PHP tag in readme.txt</li>\n<li>FIXED: PHP Fatal error for PHP &lt; 5.3</li>\n</ul>\n\n<h4>1.1.4, September 03, 2017</h4>\n\n<ul>\n<li>ADDED: Admin notice if there is no WooCommerce installed</li>\n<li>ADDED: Admin notice for better feedback from users</li>\n<li>FIXED: Deleting the \'dgwt-wcas-open\' class after hiding the suggestion</li>\n<li>FIXED: Allows displaying HTML entities in suggestions title and description</li>\n<li>FIXED: Better synchronizing suggestions and resutls on a search page</li>\n<li>CHANGE: Move menu item to WooCommerce submenu</li>\n</ul>\n\n<h4>1.1.3, July 12, 2017</h4>\n\n<ul>\n<li>ADDED: New WordPress filters</li>\n<li>FIXED: Repetitive search results</li>\n<li>FIXED: Extra details when there are no results</li>\n</ul>\n\n<h4>1.1.2, June 7, 2017</h4>\n\n<ul>\n<li>FIXED: Replace deprecated methods and functions in WC 3.0.x</li>\n</ul>\n\n<h4>1.1.1, June 6, 2017</h4>\n\n<ul>\n<li>ADDED: Added Portable Object Template file</li>\n<li>ADDED: Added partial polish translation</li>\n<li>FIXED: WooCommerce 3.0.x compatible</li>\n<li>FIXED: Menu items repeated in a search page</li>\n<li>FIXED: Other minor bugs</li>\n</ul>\n\n<h4>1.1.0, October 5, 2016</h4>\n\n<ul>\n<li>NEW: Add WPML compatibility</li>\n<li>FIXED: Repeating search results for products in a admin dashboard</li>\n<li>FIXED: Overwrite default input element rounding for Safari browser</li>\n</ul>\n\n<h4>1.0.3.1, July 24, 2016</h4>\n\n<ul>\n<li>FIXED: Disappearing widgets</li>\n<li>FIXED: Trivial things in CSS</li>\n</ul>\n\n<h4>1.0.3, July 22, 2016</h4>\n\n<ul>\n<li>FIXED: Synchronization WP Query on a search page and ajax search query</li>\n<li>CHANGE: Disable auto select the first suggestion</li>\n<li>CHANGE: Change textdomain to ajax-search-for-woocommerce</li>\n</ul>\n\n<h4>1.0.2, June 30, 2016</h4>\n\n<ul>\n<li>FIXED: PHP syntax error with PHP version &lt; 5.3</li>\n</ul>\n\n<h4>1.0.1, June 30, 2016</h4>\n\n<ul>\n<li>FIXED: Excess AJAX requests in a detail mode</li>\n<li>FIXED: Optimization JS mouseover event in a detail mode</li>\n<li>FIXED: Trivial things in CSS</li>\n</ul>\n\n<h4>1.0.0, June 24, 2016</h4>\n\n<ul>\n<li>ADDED: [Option] Exclude out of stock products from suggestions</li>\n<li>ADDED: [Option] Overwrite a suggestion container width</li>\n<li>ADDED: [Option] Show/hide SKU in suggestions</li>\n<li>ADDED: Add no results note</li>\n<li>FIXED: Search in products SKU</li>\n<li>FIXED: Trivial things in CSS and JS files</li>\n</ul>\n\n<h4>0.9.1, June 5, 2016</h4>\n\n<ul>\n<li>ADDED: Javascript and CSS dynamic compression</li>\n<li>FIXED: Incorrect dimensions of the custom preloader</li>\n</ul>\n\n<h4>0.9.0, May 17, 2016</h4>\n\n<ul>\n<li>ADDED: First public release</li>\n</ul>\";s:11:\"screenshots\";s:0:\"\";}s:14:\"upgrade_notice\";b:0;s:7:\"version\";s:6:\"1.27.1\";s:13:\"download_link\";s:389:\"https://api.freemius.com/v1/installs/14459864/updates/67946.zip?is_premium=false&authorization=FSLA+14459864%3AgE7LtojhBnLH99eipKw_ItDke6RmXDT59anuCmU_jmjYIciiw_EQwvuh_YrlLFHRNc-XU8QKJvFBkzVhJcp1eqwtQOYp-tm8Bh8l_D6D1MV-n-RMRP-m-Y6SvJDFAhUmhpNEHRZzNuvzpVdOIPN0UstLAssNRbplL3kK2UlktydV06M_EYda34PPSh7kvs_xgCeg1lp_KNqnZtR2VdrXN2NeYrUIakt8AmcBKGE7JbMboER2tI5HtntqgcfhWG9pw9GOulm4Au4znr0yY91iRQ\";}}s:7:\"created\";i:1709294121;s:9:\"timestamp\";i:1709297721;}s:67:\"get:/v1/users/8008303/plugins/700/payments.json?include_addons=true\";O:8:\"stdClass\":3:{s:6:\"result\";O:8:\"stdClass\":2:{s:8:\"payments\";a:0:{}s:9:\"discounts\";a:0:{}}s:7:\"created\";i:1709294121;s:9:\"timestamp\";i:1709380521;}}', 'no');
